  `delete_flag` smallint(1) NOT NULL COMMENT '是否有效标识 1有效 0无效',
  `like_num` int(11) NOT NULL DEFAULT '0' COMMENT '评论点赞总数',
  PRIMARY KEY (`id`),
  KEY `key_a_comment` (`activity_id`,`audit_status`)
