  `del_flag` smallint(2) DEFAULT '0' COMMENT '删除标志(0:正常使用，1:删除)',
  `create_time` datetime DEFAULT NULL COMMENT '创建日期',
  `del_time` datetime DEFAULT NULL COMMENT '删除日期',
  PRIMARY KEY (`id`)
